а. Теги заголовков должна быть между 10-60 символов.'),(1414,10,'Man könnte sagen, dass der Titel einer der wichtigsten Faktoren für eine erfolgreiche Suchmaschinen-Optimierung Ihrer Website ist. Die Titel-Tags sollte zwischen 10-60 Zeichen lang sein.'),(1414,11,'On pourrait dire que le titre est l\'un des facteurs les plus importants pour une optimisation des moteurs de recherche réussie de votre site web. Les balises de titre doit être comprise entre 10-60 caractères.'),(1414,12,'Bu başlık web sitenizin başarılı arama motoru optimizasyonu için en önemli faktörlerden biri olduğu söylenebilir. Başlık etiketleri 10-60 karakter arasında olmalıdır.\r\n'),(1414,13,'يمكن القول أن العنوان هو واحد من أهم العوامل لنجاح محرك البحث الأمثل من موقع الويب الخاص بك. يجب أن يكون بين علامات العنوان 10-60 حرفا.'),(1414,14,'Convidar notificação de pedido de\r\nPode-se dizer que o título é um dos fatores mais importantes para um bem sucedido motor de pesquisa otimização do seu site. As tags de título deve ficar entre 10-60 caracteres.'),(1416,7,'Últimamente, la etiqueta meta de palabras clave se ha convertido en la etiqueta menos importante para los buscadores y en especial Google. Sin embargo, es una manera fácil de reforzar una vez más, las palabras clave más importantes. Se recomienda su uso, ya que creemos que puede ayudar al proceso de SEO, sobre todo si se siguen las normas mencionadas a continuación. Las etiquetas de palabras clave debe contener entre 4 y 10 palabras clave.'),(1416,8,'最近，元關鍵字標籤的搜索引擎，尤其是谷歌成為最不重要的標籤。然而，這是一個簡單的方法再次加強你最重要的關鍵詞。我們建議其使用，因為我們相信，它可以幫助搜索引擎優化的過程中，特別是如果你遵循以下提到的規則。關鍵字標籤應包含4至10個關鍵字。'),(1416,9,'В последнее время, мета-тег ключевых слов стало наименее важный тег для поисковых систем, и особенно Google. Однако, это простой способ усилить еще раз наиболее важные ключевые слова. Мы рекомендуем его использование, как мы считаем, что это может помочь SEO процесс, особенно если вы будете следовать правилам, указанных ниже. Ключевыми словами должны содержать от 4 до 10 ключевых слов.'),(1416,10,'In letzter Zeit hat die Meta Keyword-Tag geworden am wenigsten wichtige Tag für die Suchmaschinen und vor allem Google. Allerdings ist es eine einfache Möglichkeit, wieder verstärken Sie Ihre wichtigsten Schlüsselwörter enthält. Wir empfehlen die Nutzung, da wir glauben, dass es die SEO Prozess zu helfen, vor allem, wenn Sie die hier genannten Regeln folgen. Die Keyword-Tags enthalten sollte zwischen 4 und 10 Keywords.'),(1416,11,'Dernièrement, la balise meta keyword est devenu la balise moins important pour les moteurs de recherche et en particulier Google. Cependant, il est un moyen facile de renforcer une nouvelle fois vos mots clés les plus importants. Nous recommandons son utilisation car nous pensons que cela peut aider le processus de référencement, surtout si vous suivez les règles mentionnées ci-dessous. Les balises de mots clés doit contenir entre 4 et 10 mots-clés.'),(1416,12,'Son zamanlarda, meta anahtar kelime etiketi arama motorları ve özellikle Google için en önemli etiket haline gelmiştir. Ancak, bir kez daha en önemli anahtar kelimeleri pekiştirmek için kolay bir yoldur. Biz aşağıda belirtilen kuralları takip, özellikle eğer SEO işlemi yardımcı olabilir inanıyorum Biz kullanım öneririz. Anahtar sözcük etiketleri 4 ile 10 arasında değişen anahtar kelimeler içermelidir.'),(1416,13,'في الآونة الأخيرة، أصبحت العلامة الوصفية الكلمة العلامة الأقل أهمية لمحركات البحث وجوجل على وجه الخصوص. ومع ذلك، فإنه هو وسيلة سهلة لتعزيز مرة أخرى كلماتك الرئيسية الأكثر أهمية. نوصي استخدامه لأننا نعتقد أن ذلك قد يساعد في عملية جنوب شرقي أوروبا، وخاصة إذا كنت تتبع القواعد المذكورة أدناه. يجب أن تحتوي الكلمة به بين 4 و 10 الكلمات الرئيسية.'),(1416,14,'Ultimamente, a palavra-chave tag meta tornou-se o tag menos importante para os motores de busca e, especialmente, do Google. No entanto, é uma maneira fácil para reforçar mais uma vez as palavras-chave mais importantes. Recomendamos sua utilização como acreditamos que ele pode ajudar o processo de SEO, especialmente se você seguir as regras abaixo mencionados. As tags de palavras-chave deve conter entre 4 e 10 palavras-chave.'),(3058,11,'Derniers articles'),(1463,7,'Últimas pines'),(1463,8,'最新的銷'),(1463,9,'Последние контакты'),(1463,10,'Neueste Stifte'),(1463,11,'Derniers broches'),(1463,12,'En son işaretçilerine'),(1463,13,'أحدث دبابيس'),(1463,14,'Últimas pinos'),(1373,7,'Lugar'),(1373,8,'區域設置'),(1373,9,'Место действия'),(1373,10,'Schauplatz'),(1373,11,'Lieu'),(1373,12,'Locale'),(1373,13,'مكان'),(1373,14,'Localidade'),(1478,7,'Ingresa problemas'),(1478,8,'登錄麻煩'),(1478,9,'Войти проблемы'),(1478,10,'Einloggen Probleme'),(1478,11,'Connexion difficultés'),(1478,12,'Sorun Giriş'),(1478,13,'مشكلة الدخول'),(1478,14,'Entrar problemas'),(1377,7,'Salir'),(1377,8,'退出'),(1377,9,'Выход'),(1377,10,'Abmelden'),(1377,11,'Déconnexion'),(1377,12,'Çıkış'),(1377,13,'خروج'),(1377,14,'Sair'),(1487,7,'Formato de fecha larga'),(1487,8,'長日期格式'),(1487,9,'Длинный формат даты'),(1487,10,'Langes Datumsformat'),(1487,11,'Format de date longue'),(1487,12,'Uzun tarih biçimi'),(1487,13,'تنسيق التاريخ الطويل'),(1487,14,'Formato de longa data'),(1488,7,'Formato de fecha larga en el tiempo'),(1488,8,'隨著時間的長日期格式'),(1488,9,'Длинный формат даты со временем'),(1488,10,'Langes Datumsformat mit der Zeit'),(1488,11,'Format de date longue dans le temps'),(1488,12,'Zamanla Uzun tarih biçimi'),(1488,13,'تنسيق التاريخ الطويل مع الوقت'),(1488,14,'Formato de longa data com o tempo'),(1378,7,'Gestión de la configuración del sistema'),(1378,8,'系統設置管理'),(1378,9,'Управление настройками системы'),(1378,10,'Management von System-Einstellungen'),(1378,11,'Gestion des paramètres du système'),(1378,12,'Sistem ayarları Yönetimi'),(1378,13,'إدارة إعدادات النظام'),(1378,14,'Gerenciamento de configurações do sistema'),(1461,7,'Límite máximo para los archivos de la galería de subida. Establezca 0 para desactivar límite (no recomendado)!'),(1461,8,'畫廊上傳最大文件限制。設置0禁用限制（不推薦）！'),(1461,9,'Максимальный предел для файлов Галер