ю информацию ваш сайт содержит или то, что ваш сайт о. Писать короткие и четкие предложения, которые не спутаешь ваших посетителей. Описание тега должна быть не менее 200 символов.\r\n'),(1418,10,'Die Beschreibung Tag sollte in einer solchen Weise, dass es zeigt, welche Informationen Ihre Website enthält oder was Ihre Website geht geschrieben werden. Schreiben Sie kurze und klare Sätze, die nicht zu verwechseln Ihre Besucher. Die Beschreibung tag sollte weniger als 200 Zeichen.'),(1418,11,'La balise de description doit être rédigé de façon à ce qu\'il indique quelles sont les informations de votre site Web contient ou ce que votre site est sur. Faites des phrases courtes et claires qui ne seront pas confondre vos visiteurs. La balise de description doit être inférieure à 200 caractères.'),(1418,12,'Açıklaması etiketi web sitenize içeren ya da ne web siteniz hakkında ne bilgiler gösterecektir ki böyle bir şekilde yazılmalıdır. Ziyaretçilerinizin karıştırmayın olmaz kısa ve net cümleler yazın. Açıklama etiketi 200 karakterden az olmalıdır'),(1418,13,'يجب أن تكتب وصف العلامة في مثل هذه الطريقة أنها سوف تظهر ما هي المعلومات التي يحتوي موقع الويب الخاص بك أو موقع الويب الخاص بك ما هو حول. كتابة جمل قصيرة وواضحة من شأنها أن لا تخلط بين زوار موقعك. يجب أن يكون وصف العلامة أقل من 200 حرفا.'),(1418,14,'A tag descrição deve ser escrito de tal forma que ele irá mostrar as informações que o seu site contém ou o que o site é sobre. Escrever frases curtas e claro que não vai confundir seus visitantes. O Tag da descrição deve ser inferior a 200 caracteres.'),(1446,7,'Estas funciones le permiten obtener la fecha y la hora del servidor en el que los scripts PHP se ejecutan. Puede utilizar estas funciones para dar formato a la fecha y hora de muchas maneras diferentes.'),(1446,8,'這些功能讓你得到你的PHP腳本運行從服務器的日期和時間。您可以使用這些函數，在許多不同的方式格式化的日期和時間。'),(1446,9,'Эти функции позволят вам получить дату и время с сервера, где ваши PHP скрипты работают. Вы можете использовать эти функции для форматирования даты и времени по-разному.'),(1446,10,'Diese Funktionen ermöglichen es Ihnen, das Datum und die Uhrzeit auf dem Server, wo Ihre PHP-Skripte zum Laufen zu bringen. Sie können diese Funktionen, um das Datum und die Uhrzeit auf viele verschiedene Weisen zu formatieren.'),(1446,11,'Ces fonctions vous permettent d\'obtenir la date et l\'heure du serveur sur lequel vos scripts PHP s\'exécutent. Vous pouvez utiliser ces fonctions pour formater la date et l\'heure de nombreuses façons différentes.'),(1446,12,'Bu işlevler PHP betikleri çalıştıran sunucudan tarih ve saati almak için izin verir. Siz çok farklı şekillerde tarih ve saat formatlamak için bu işlevleri kullanabilirsiniz.'),(1446,13,'هذه الوظائف تسمح لك للحصول على التاريخ والوقت من الملقم حيث يتم تشغيل البرامج النصية PHP الخاصة بك. يمكنك استخدام هذه الوظائف لتنسيق التاريخ والوقت في العديد من الطرق المختلفة.'),(1446,14,'Estas funções permitem que você obtenha a data ea hora do servidor onde o PHP está sendo executado. Você pode usar estas funções para formatar a data e hora de muitas maneiras diferentes.'),(1420,7,'Este campo es obligatorio'),(1420,8,'此字段是必需'),(1420,9,'Это поле обязательно'),(1420,10,'Dieses Feld ist erforderlich'),(1420,11,'Ce champ est obligatoire'),(1420,12,'Bu alanın doldurulması zorunludur'),(1420,13,'هذا الحقل مطلوب'),(1420,14,'Este campo é necessário'),(1402,7,'Título'),(1402,8,'標題'),(1402,9,'Название'),(1402,10,'Titel'),(1402,11,'Titre'),(1402,12,'Başlık'),(1402,13,'لقب'),(1402,14,'Título'),(1449,7,'Total de comentarios en el listado'),(1449,8,'房產總評論'),(1449,9,'Всего комментариев в листинге'),(1449,10,'Kommentare insgesamt in Listing'),(1449,11,'Nombre de commentaires dans la cotation'),(1449,12,'Listeleme Toplam yorum'),(1449,13,'مجموع التعليقات في قائمة'),(1449,14,'Total de comentários em lista'),(1447,7,'Subir método de almacenamiento'),(1447,8,'上傳存儲方法'),(1447,9,'Загрузите метод хранения'),(1447,10,'Hochladen Speichermethode'),(1447,11,'Téléchargez méthode de stockage'),(1447,12,'Depol